import './App.css';
import Top from "./myComponent/Top";
import BlankTextImage from "./myComponent/BlankTextImage";
import logo from "./img/artificial-intelligence.png"
import rocketBlankTextImage from "./img/rocket.png"
import playIcon from "./img/playIcon.png"
import UlFlexImg from "./myComponent/UlFlex";
import logoUl1 from "./img/logoUl1.png";
import brain from "./img/brain.png";
import smartphone from "./img/smartphone.png";
import logoUl2 from "./img/logoUl2.png"
import logoUl3 from "./img/logoUl3.png"
import logoUl4 from "./img/logoUl4.png"
import logoUl11 from "./img/logoUl11.png"
import logoUl12 from "./img/logoUl12.png"
import logoUl13 from "./img/logoUl13.png"
import logoUl14 from "./img/logoUl14.png"
import logoUl15 from "./img/logoUl15.png"
import UlFlexImgText from "./myComponent/UlFlexImgText";

let logoUlimg1 = [
    logoUl1,
    logoUl2,
    logoUl3,
    logoUl4
]
let logoUlimg2 = [
    logoUl11,
    logoUl12,
    logoUl13,
    logoUl14,
    logoUl15
]

function App() {
  return (
    <div className="App">
        <Top img={logo} />
        <BlankTextImage
            dark={true}
            img={rocketBlankTextImage}
            imgButton2={playIcon}
            topText={"Next genaretion platform"}
            h1Text={"Artificial intelligence & Syber security"}
            mainText={"Lorem ipsum is placeholder text commonly " +
                "used in the graphic, print, and publishing " +
                "industries for previewing layouts and visual mockups."}
            button={2}
            button1={"Get Started"}
            button2={"Watch Video"}
        />
        <UlFlexImg
            count={4}
            img={logoUlimg1}
            backgroundColor={'#0d1a2c'}

        />
        <BlankTextImage
            dark={false}
            img={smartphone}
            topText={"Next genaretion platform"}
            h1Text={"Artificial intelligence & Syber security"}
            mainText={"Lorem ipsum is placeholder text commonly " +
                "used in the graphic, print, and publishing " +
                "industries for previewing layouts and visual mockups."}
            button={1}
            button1={"Learn More"}
        />
        <UlFlexImgText
            count={5}
            img={logoUlimg2}
            backgroundColor={"#0d1a2c"}
            h1Text1={"Naxly as the Winners in Global Agency Awards"}
            text1={"Lorem ipsum is placeholder text commonly used in print, and publishing industries for previewing layouts and visual mockups."}

            h1Text2={"Expert Prespective Agency Awards"}
            text2={"Lorem ipsum is placeholder text commonly used in print, and publishing industries for previewing layouts and visual mockups."}

            h1Text3={"Business Prespective Global Agency Awards"}
            text3={"Lorem ipsum is placeholder text commonly used in print, and publishing industries for previewing layouts and visual mockups."}

            h1Text4={"Value for Results in Global Agency Awards"}
            text4={"Lorem ipsum is placeholder text commonly used in print, and publishing industries for previewing layouts and visual mockups."}

            h1Text5={"Global Experience in Agency Awards"}
            text5={"Lorem ipsum is placeholder text commonly used in print, and publishing industries for previewing layouts and visual mockups."}


        />
    </div>
  );
}

export default App;

